import { useState, useCallback } from 'react';

export default function useMostClickedColor(color) {
    const [mostClicked, setMostClicked] = useState(null);
    const [clickedCounterState, setClickedCounterState] = useState(null);

    const setClickedCounter = useCallback(() => {
        setClickedCounterState(mostClicked + 1);
        if (clickedCounterState > mostClicked) {
            setMostClicked(clickedCounterState);
        }
    }, [clickedCounterState, mostClicked]);

    return { mostClicked, setClickedCounter };
}
